import React from 'react';

type Process = {
  id: number
  name: string
  value: string
}

const MC: Process[] = [
  {
    id: 0,
    name: "MC仕掛",
    value: "MC"
  }, {
    id: 1,
    name: "MC1-40",
    value: "MC1-40"
  }, {
    id: 2,
    name: "MC1-50",
    value: "MC1-50"
  }, {
    id: 3,
    name: "VM53R",
    value: "VM53R"
  }, {
    id: 4,
    name: "VM73",
    value: "VM73"
  }
]
const LE: Process[] = [
  {
    id: 0,
    name: "LE仕掛",
    value: "LE"
  }, {
    id: 1,
    name: "LE",
    value: "LE"
  }, {
    id: 2,
    name: "LEプログラム作成",
    value: "LE-PRG"
  }, {
    id: 3,
    name: "森精機",
    value: "LE-MORI"
  }, {
    id: 4,
    name: "中村留",
    value: "LE-TOME"
  }
]

const Process: React.FC = () => {
  return (
    <div className="Process">
      <form>
        <select>
          { MC.map((item: Process) => (
            <option key={ item.id }>{ item.name }</option>
          )) }
        </select>
      </form>
    </div>
  )
}


export default Process;
